    public int lengthOfLongestSubstring2(String s) {
        int len = s.length();
        if (len == 1) {
            return 1;
        }

        int maxLength = 0;

        char[] chars = s.toCharArray();

        int[] counters = new int[len];
        int[] values = new int[len];
        for (int i = 0; i < len; i++) {
            int token = chars[i];
            values[i] = token;
            counters[i] = 0;
            maxLength = calculateMaxLength(counters, i, maxLength);
            for (int j = 0; j < i; j++) {
                if (values[j] == token) {
                    counters[j]++;
                }
            }
        }

        return maxLength;

    }

    private int calculateMaxLength(int[] counters, int end, int length) {
        int tmpLength = 0;
        for (int i = 0; i <= end; i++) {
            if (counters[i] == 0) {
                tmpLength++;
            } else {
                if (length < tmpLength) {
                    length = tmpLength;
                }
                tmpLength = 0;
            }
        }
        if (length < tmpLength) {
            length = tmpLength;
        }
        return length;
    }

    // viewed solution - HashSet is cool
    public int lengthOfLongestSubstring(String s) {
        int len = s.length();
        if (len == 1) {
            return 1;
        }

        int maxLength = 0;
        int i = 0;
        int j = 0;
        Set<Character> dataset = new HashSet<>();

        while (i < len && j < len) {
            char token = s.charAt(j);
            if (!dataset.contains(token)) {
                dataset.add(token);
                j++;
                maxLength = Math.max(maxLength, j - i);
            } else {
                dataset.remove(s.charAt(i++));
            }
        }

        return maxLength;
    }

    private boolean isUnique(byte[] arr) {
        for (int i = 0; i < arr.length - 1; i++) {
            if (arr[i] == arr[i + 1]) return false;
        }
        return true;
    }

